import { Box, Link, Typography } from "@mui/material";

const Footer = () => {
  return (
    <Box
      sx={{
        display: "flex",
        // height: "100px",
        backgroundColor: "rgb(5	59 136)",
        justifyContent: "center",
        alignItems: "center",
        marginTop: "50px",
      }}
    >
      <Typography>
        &copy; {new Date().getFullYear()}{" "}
        <Link
          style={{ color: "inherit" }}
          href="https://github.com/tiffanydiandra/beauty-supply-store"
        >
          BSS.
        </Link>{" "}
        All Rights Reserved.
      </Typography>
    </Box>
  );
};

export default Footer;
